import React, { useState } from "react";
import axios from "../../api/axiosClient";

export default function AddProductModal({ onClose, onCreated }) {
  const [form, setForm] = useState({
    name: "",
    unit: "",
    category: "",
    brand: "",
    stock: 0,
    status: "",
    image: ""
  });

  const [error, setError] = useState(null);
  const [duplicateWarning, setDuplicateWarning] = useState(null);

  const handleChange = (key, value) => {
    setForm({ ...form, [key]: value });
  };

  const handleSubmit = async () => {
    setError(null);
    setDuplicateWarning(null);

    try {
      const res = await axios.post("/api/products", form);
      onCreated(res.data); // notify parent to refresh table
      onClose(); // close modal
    } catch (err) {
      const resp = err.response;

      if (resp && resp.status === 409 && resp.data.error === "duplicate") {
        setDuplicateWarning({
          existingId: resp.data.existingId,
          name: resp.data.name
        });
        return;
      }

      setError(resp?.data?.error || "Something went wrong");
    }
  };

  return (
    <div
      style={{
        position: "fixed",
        top: 0, left: 0,
        width: "100%", height: "100%",
        backgroundColor: "rgba(0,0,0,0.3)",
        display: "flex", justifyContent: "center", alignItems: "center"
      }}
    >
      <div style={{ background: "white", padding: 20, width: 350 }}>
        <h3>Add New Product</h3>

        <label>Name</label>
        <input
          value={form.name}
          onChange={(e) => handleChange("name", e.target.value)}
          style={{ width: "100%", marginBottom: 10 }}
        />

        <label>Unit</label>
        <input
          value={form.unit}
          onChange={(e) => handleChange("unit", e.target.value)}
          style={{ width: "100%", marginBottom: 10 }}
        />

        <label>Category</label>
        <input
          value={form.category}
          onChange={(e) => handleChange("category", e.target.value)}
          style={{ width: "100%", marginBottom: 10 }}
        />

        <label>Brand</label>
        <input
          value={form.brand}
          onChange={(e) => handleChange("brand", e.target.value)}
          style={{ width: "100%", marginBottom: 10 }}
        />

        <label>Stock</label>
        <input
          type="number"
          value={form.stock}
          onChange={(e) => handleChange("stock", Number(e.target.value))}
          style={{ width: "100%", marginBottom: 10 }}
        />

        <label>Status</label>
        <input
          value={form.status}
          onChange={(e) => handleChange("status", e.target.value)}
          style={{ width: "100%", marginBottom: 10 }}
        />

        <div style={{ marginTop: 15 }}>
          <button onClick={handleSubmit} style={{ marginRight: 10 }}>
            Create
          </button>
          <button onClick={onClose}>Cancel</button>
        </div>

        {error && (
          <div style={{ color: "red", marginTop: 10 }}>
            {error}
          </div>
        )}

        {duplicateWarning && (
          <div style={{ marginTop: 15, padding: 10, border: "1px solid orange" }}>
            <strong>Duplicate product found:</strong><br />
            A product named <b>{duplicateWarning.name}</b> already exists.
            <br /><br />

            <button
              onClick={() => {
                // Auto-suggest new name
                setForm({
                  ...form,
                  name: form.name + " (copy)"
                });
                setDuplicateWarning(null);
              }}
              style={{ marginRight: 10 }}
            >
              Create as Copy
            </button>

            <button
              onClick={() => setDuplicateWarning(null)}
            >
              Rename & Retry
            </button>
          </div>
        )}
      </div>
    </div>
  );
}
